import React from 'react';
import './css/UploadBar.css'

class UploadBar extends React.Component {
    render() {
        return(
            <div class="upload-bar-wrapper position-absolute fixed-bottom border border-secondary">Upload bar wrapper</div>
        )
    }
} 

export default UploadBar;
